async function (source, searchString) {
  let entries = _.toPairs(source);
  let output = {};
  for (let i = 0; i < entries.length; i++) {
    let parentKey = entries[i][0];
    let parentValue = entries[i][1];
    if (parentKey.includes(searchString)) {
      _.set(output, [parentKey], parentValue);
    } else {
      if (_.isObject(parentValue)) {
        let childEntries = _.toPairs(parentValue);
        for (let j = 0; j < childEntries.length; j++) {
          let childKey = childEntries[j][0];
          let childValue = childEntries[j][1];
          if (childKey.includes(searchString)) {
            _.set(output, [parentKey, childKey], childValue);
          }
        }
      }
    }
  }
  console.log(output);
  await storeValue("hardwareConfig", output, false);
}
